import styled from "styled-components";


export const StyledFormContainer = styled.form`
display: flex;
background-color: red;
margin: auto;
width: 30%;
flex-direction: column;
position: relative;
top: 400px;
gap: 16px;

div{
    display: flex;
    width: 300px;
    justify-content: space-between;
}

button{
    margin-top: 16px;
    width: auto;
}
`
